import blogs from "../services/blogs";
import Togglable from "./Togglable";
const Blog = ({ blog }) => {
	const blogStyle = {
		paddingTop: 10,
		paddingLeft: 2,
		border: "solid",
		borderWidth: 1,
		marginBottom: 5,
    display:"flex"
	};

	return (
		<div style={blogStyle}>
			<p>title :{blog.title}</p>
			<Togglable buttonLabel="show">
				<p>author :{blog.author}</p>
				<p>url :{blog.url}</p>
				<p>likes :{blog.likes}</p>
			</Togglable>
		</div>
	);
};

export default Blog;
